import { styled } from "styled-components";
import ProfileHeader from "../component/user/ProfileHeader"
import SideBar from "../component/SideBar";
import ProfileCartegory from "../component/user/ProfileCategory"

const ProfilePageContainer = styled.div`
  display: flex;
`
const ProfileContainer = styled.div`
  width: 100%;
  margin: 30px;
`
const StatsContainer = styled.section`
  width: 600px;
  margin-left: 20px;
  > h2 {
  }
  > .StatsBox{
    border: 2px solid var(--silver);
    border-radius: 20px;
    height: 200px;
    width: 100%;
    display: flex;
    flex-direction: column;
    > .column {
      display: flex;
      flex-grow: 1;
      > .stat {
        margin: 0 30px;
        margin-right: 180px;
        & > :first-child {
          font-size: 130%;
          color: var(--black);
        }
        & > :last-child {
          color: var(--silver-darker);
        }
      }
  }
  }
`
const ActivityContainer = styled.section`
  height: 400px;
  width: 500px;
  display: flex;
  flex-direction: column;
  > .ActivityHeader{
    display: flex;
    justify-content: space-between;

  }
  > .ActivityBox {
    border: 1px solid var(--silver);
    border-radius: 10px;
    flex-grow: 1;
    display: flex;
    flex-direction:column;
    > .ActivityItem {
      display: flex;
      border-bottom: 0.1px solid var(--silver);
      border-radius: 10px;
      width: 100%;
      height: 20%;
      justify-content: space-around;
      align-items: center;
      > .view {
        display: flex;
        justify-content: center;
        align-items: center;
        height: 50%;
        width: 0;

        background-color: var(--green-600);
        color: var(--white);
      }
      > .title {
        flex-grow: 5;
      }
      > .createdAt {
        flex-grow: 1;
      }
    }
  }

`

function Profile() {
  return (
    <ProfilePageContainer>
      <SideBar/>
      <ProfileContainer>
        <ProfileHeader/>
        <ProfileCartegory text={`Profile`}/>

        <StatsContainer>
          <h2>Stats</h2>
          <div className="StatsBox">
            <div className="column">
              <div className="stat">
                <p>a</p>
                <p>questions</p>
              </div>
              <div className="stat">
                <p>a</p>
                <p>answers</p>
              </div>
            </div>
            <div className="column">
              <div className="stat">
                <p>a</p>
                <p>createdAt</p>
              </div>
              <div className="stat">
                <p>a</p>
                <p>email</p>
              </div>
            </div>
          </div>
        </StatsContainer>
        <ProfileCartegory text={`Activity`}/>
        <ActivityContainer>
          <div className="ActivityHeader">
            <h2>Question</h2>
            <p>버튼위치</p>
          </div>
          <div className="ActivityBox">
            <div className="ActivityItem">
              <p className="view">View</p>
              <p className="title">title</p>
              <p className="createdAt">createdAt</p>
            </div>
            <div className="ActivityItem"></div>
            <div className="ActivityItem"></div>
            <div className="ActivityItem"></div>
          </div>
        </ActivityContainer>
      </ProfileContainer>
    </ProfilePageContainer>
  );
}

export default Profile;
